// ==UserScript==
// @name         Scratch Autosave
// @namespace    http://tampermonkey.net/
// @version      2025-07-17
// @description  Effortlessly auto-save your Scratch Projects while editing!
// @author       codecool123
// @match        *://scratch.mit.edu/projects/*/editor
// @icon         data:image/png;base64,
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    function isVisible(el) {
        return el && el.offsetParent !== null;
    }

    function tryClickSaveSCR() {
        const SCRSaveBtn = document.querySelector('.save-status_save-now_c2ybV');
        if (SCRSaveBtn && isVisible(SCRSaveBtn)) {
            SCRSaveBtn.click();
        }
    }

    // Retry every 2 seconds to avoid spamming clicks
    setInterval(tryClickSaveSCR, 1000);
})();
